from dataclasses import dataclass

@dataclass
class Color:
    r: int
    g: int
    b: int

    def hex(self) -> str:
        return f'#{self.r:02x}{self.g:02x}{self.b:02x}'

    def lum(self) -> float:
        dr = float(self.r) / 255.0
        dg = float(self.g) / 255.0
        db = float(self.b) / 255.0

        def srgb_lin(n) -> float:
            if (n <= 0.04045):
                return n / 12.92
            else:
                return ((n + 0.055) / 1.055) ** 2.4

        sr = srgb_lin(dr)
        sg = srgb_lin(dg)
        sb = srgb_lin(db)

        return (0.2126 * dr) + (0.7152 * dg) + (0.0722 * db)

    def lightness(self) -> float:
        l = self.lum()
        if l <= (216 / 24389):
            return l * 24389 / 27
        else:
            return (l ** (1 / 3)) * 116 - 16

    def ansi_bg(self) -> None:
        print(f'\x1b[48;2;{self.r};{self.g};{self.b}m', end='')

    def ansi_fg(self) -> None:
        print(f'\x1b[38;2;{self.r};{self.g};{self.b}m', end='')

    def dump(self) -> None:
        self.ansi_bg()
        if self.lum() > 0.5:
            Color(0, 0, 0).ansi_fg()
        else:
            Color(255, 255, 255).ansi_fg()
        print(self.hex())
        print('\x1b[0m', end='')


def c(r: int, g: int, b: int) -> Color:
    return Color(r, g, b)

