def sample(n: float) -> Color:
    assert n >= 0 and n <= 1
    global raw
    idx = int(n * (len(raw) - 1))
    return raw[idx]


def main():
    n = 16
    for i in range(n):
        f = i / (n - 1)
        print(f'{i:02}: {f:02f}\t', end='')
        sample(f).dump()


if __name__ == '__main__':
    main()
